import React, {Fragment} from 'react';
import { PropTypes } from 'prop-types';
import { Moment } from 'react-moment';

const ProfileAbout = props => {
  return (  
    <div>
      <h3 className="text-dark"> {props.experience.company} </h3>
      <p> 
        <Moment format='YYYY/MM/DD'> {props.experience.from} </Moment> - {' '}
        {!props.experience.to ? ' Now' : <Moment format='YYYY/MM/DD'> {props.experience.to} </Moment>}
      </p>
    </div>
  );
}
 
ProfileAbout.protoTypes = {
  experience: PropTypes.array.isRequired,

}

export default ProfileAbout;
